import React from 'react';
import {Text, View, StyleSheet, ImageBackground} from 'react-native';
import {PrimaryButton} from '../assets/components/button';
import COLORS from '../assets/components/color';
import {Row, Col} from 'antd';

export default function OnBoard() {
    return (
        <View style={style.container}>
            <ImageBackground  style={style.image} source={require('../assets/green.png')}>
                <Row>
                    <Col span={8}>
                        <Text style={{fontSize: 48, fontWeight: 'bold', color: COLORS.primary}}>Find Your Needs</Text>
                        <PrimaryButton title="SHOP NOW"/>
                    </Col>
                </Row>
            </ImageBackground>
        </View>
    );
};

const style = StyleSheet.create({
    container: {
        flex: 1
    },
    image: {
        flex: 1,
        resizeMode: "cover",
        justifyContent: "left"
    },
    content: {
        flex: 1,
        justifyContent: "left",
        flexDirection: 'row'
    }
});
